(function(global, factory) {
  global.Loading = factory()
}(this, (function() {
  class Pane {
    constructor({msg, timeout, callback}) {
      this.mask = this.initDialog({msg, timeout, callback})
    }
    initDialog({msg, timeout, callback}) {
      var loadingIcon = `data:image/gif;base64,`
      var el = document.createElement('div')
      el.style = 'position: fixed; top: 0;right: 0;bottom: 0;left: 0;display: flex;align-items: center; justify-content: center;z-index: 9999;background-color: rgba(0, 0, 0, 0.7);flex-flow: column;'
      //loading 
      var loadingImage = document.createElement('img')
      loadingImage.src = loadingIcon;
      //loading 
      var title = document.createElement('div')
      title.innerHTML = msg
      title.style = 'color: #FFF; margin-top: 5px;font-size: 20px;'
      el.appendChild(loadingImage)
      el.appendChild(title)

      document.body.appendChild(el);
      if (timeout) {
        setTimeout(() => {
          callback && callback();
        }, timeout);
      }
      return el;
    }
    remove() {
      this.mask.remove();
    }
  };
  class frame {
    constructor({msg, timeout, callback}) {
      this.mask = new Pane({msg, timeout, callback: () => {
        this.close()
        callback && callback();
      }});
    }
    close() {
      this.mask.remove()
    }
  }
  return frame;
})))
